import React, { Component } from "react";

import {
  PageMain,
} from "core";
import NotificationSystem from "react-notification-system";
import FacilityTypeListSection from "../../sections/basePage/facilityTypeListSection";

class FacilityTypetListPage extends React.Component {
  constructor(props) {
    super(props);

    this.state = {};
    this.notificationSystem = React.createRef();
  }
  render() {
    return (
      <PageMain
        title="فهرست شرح درخواست "
        icon="list-details"
        context={this}
        footerLinks={[
          { href: "/", text: "صفحه اصلی" },
          { href: "https://banksepah.ir", text: "وب سایت رسمی بانک سپه" },
        ]}
      >
        <FacilityTypeListSection />
        <NotificationSystem ref={ this.notificationSystem } />
      </PageMain>
    );
  }
}

export default FacilityTypetListPage;
